import { useEffect } from "react";

const LogoParticles = () => {
  useEffect(() => {
    const cleanUpParticleSlider = () => {
      const existingCanvas = document.querySelectorAll("#particle-slider canvas");
      existingCanvas.forEach((canvas) => canvas.remove());
      console.log("Removed existing canvases.");
    };

    const init = () => {
      const isMobile =
        navigator.userAgent &&
        navigator.userAgent.toLowerCase().indexOf("mobile") >= 0;
      const isSmall = window.innerWidth < 1000;

      const sliderContainer = document.getElementById("particle-slider");
      if (!sliderContainer) {
        console.error("Slider container not found");
        return;
      }

      const canvas = document.createElement("canvas");
      canvas.className = "draw";
      sliderContainer.appendChild(canvas);

      try {
        const particleSlider = new (window as any).ParticleSlider({
          ptlGap: isMobile || isSmall ? 0 : 0,
          ptlSize: isMobile || isSmall ? 1 : 1,
          width: window.innerWidth,
          height: window.innerHeight,
          mouseForce: 6000,
        });

        window.addEventListener("mousemove", (event) => {
          const adjustedMouseX = (event.clientX / window.innerWidth) * canvas.width;
          const adjustedMouseY = (event.clientY / window.innerHeight) * canvas.height;

          particleSlider.mouse = { x: adjustedMouseX, y: adjustedMouseY };
        });

        console.log("Particle slider initialized.");
      } catch (error) {
        console.error("Error initializing ParticleSlider:", error);
      }
    };

    const initParticleSlider = () => {
      cleanUpParticleSlider();

      const psScript = document.createElement("script");
      psScript.onload = () => {
        requestAnimationFrame(() => {
          const slides = document.querySelector(".slides");
          if (slides) (slides as HTMLElement).style.display = "none";
          init();
        });
      };
      psScript.src =
        "https://s3-us-west-2.amazonaws.com/s.cdpn.io/23500/ps-0.9.js";
      psScript.type = "text/javascript";
      document.body.appendChild(psScript);
    };

    initParticleSlider();

    return () => cleanUpParticleSlider();
  }, []);

  return (
        <div className="relative w-full h-screen overflow-hidden">
      <div
        id="particle-slider"
        className="absolute left-[27%] w-[200vw] h-screen overflow-hidden"
      >
    <div className="slides">
        <div
          className="slide"  
          data-src="data:image/png;base64,"
        ></div>
      </div>
      </div>
    </div>
  );
};

export default LogoParticles;
